(10, 3, 2, '<p class=\"MsoListParagraph\" style=\"margin-left:0cm;mso-add-space:auto;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Times New Roman&quot;,serif\">Nurul\r\nakan melaksanakan praktikum uji coba makanan. Namun sebelum melakukan\r\npraktikum, nurul mencoba membuat prediksi yang akan terjadi setelah diberikan\r\nreagen pada makanan. Pasangkanlah prediksi yang tepat pada kolom di bawah ini\r\ndengan menggunakan informasi pada Tabel 1!<o:p></o:p></span></p>', '[{\"tipe\":\"teks\",\"value\":\"<p class=\\\"MsoNormal\\\"><b><span style=\\\"font-size:10.0pt;line-height:107%;\\r\\nfont-family:&quot;Times New Roman&quot;,serif\\\">Stimulus soal 1-5<o:p><\\/o:p><\\/span><\\/b><\\/p><p class=\\\"MsoNormal\\\"><b><span style=\\\"font-size:10.0pt;line-height:107%;\\r\\nfont-family:&quot;Times New Roman&quot;,serif\\\">&nbsp;<\\/span><\\/b><\\/p><p class=\\\"MsoNormal\\\" align=\\\"center\\\" style=\\\"text-align:center\\\"><b><span style=\\\"font-size:10.0pt;line-height:107%;font-family:&quot;Times New Roman&quot;,serif\\\">Uji\\r\\nMakanan<o:p><\\/o:p><\\/span><\\/b><\\/p><p class=\\\"MsoNormal\\\" style=\\\"text-align:justify\\\"><span style=\\\"font-size:10.0pt;\\r\\nline-height:107%;font-family:&quot;Times New Roman&quot;,serif\\\">Kandungan bahan makanan\\r\\ndiketahui melalui praktikum uji makanan. Ada empat bentuk uji makanan yaitu uji\\r\\namilum, glukosa, protein, dan lemak.&nbsp;&nbsp;\\r\\nUji coba makanan dapat dilihat menggunakan bantuan reagen dengan melihat\\r\\nperubahan warna yang terjadi. Hal ini dapat dilihat pada tabel 1 berikut ini.<o:p><\\/o:p><\\/span><\\/p><p class=\\\"MsoNormal\\\" style=\\\"text-align:justify\\\"><span style=\\\"font-size:10.0pt;\\r\\nline-height:107%;font-family:&quot;Times New Roman&quot;,serif\\\">&nbsp;<\\/span><\\/p><p class=\\\"MsoNormal\\\" align=\\\"center\\\" style=\\\"text-align:center\\\"><span style=\\\"font-size:10.0pt;line-height:107%;font-family:&quot;Times New Rom